import { useEffect, useState } from "react";
import styled from "../styles/login_style";

function LoginPage() {

    const [usr_id, setId] = useState("");

    const idHandler = (e) => {
        setId(e.target.value);
    }


    return(
        <styled.Login_wrapdiv>
            <styled.Login_message>
                이메일과 비밀번호를 입력해주세요
            </styled.Login_message>
            <form>
                <styled.Email_wrap>
                    <div><styled.Login_inputType>이메일 주소</styled.Login_inputType></div>
                    <styled.Login_input type="id" value={usr_id} onChange={idHandler}/>
                    <div><span>{usr_id}</span></div>
                </styled.Email_wrap>
                <styled.Password_wrap>
                    <div><styled.Login_inputType>비밀번호</styled.Login_inputType></div>
                    <styled.Login_input type="password" placeholder="영문 숫자 특수문자 포함 8자 이상"></styled.Login_input>
                    <div><span>Error Handler</span></div>
                </styled.Password_wrap>
                <div>
                    <styled.Login_submit type="submit" value={"확인"}/>
                </div>
            </form>
        </styled.Login_wrapdiv>
    );
}

export default {LoginPage};
